CSPkgHead = Struct(
	"CmdID" / Enum(Int16ub, CS_CMD_ID), 
	"HeadLen" / Int16ub, 
	"BodyLen" / Int32ub, 
	"SeqID" / Int32ub, 
	"NoUse" / Int32ub, 
)

def CSPkgBody(selector):
	return Switch(selector, {
		CS_CMD_ID.CS_CMD_LIST_ROLE_REQ: CSListRoleReq, # Name:ListRoleReq
		CS_CMD_ID.CS_CMD_LIST_ROLE_RSP: CSListRoleRsp, # Name:ListRoleRsp
        CS_CMD_ID.CS_CMD_SELECT_ROLE_REQ: CSSelectRoleReq, # Name:SelectRoleReq
		CS_CMD_ID.CS_CMD_SELECT_ROLE_RSP: CSSelectRoleRsp, # Name:SelecteRoleRsp
        CS_CMD_ID.CS_CMD_CHECK_VERSION_REQ: CSCheckVersionReq, # Name:CheckVersionReq
		CS_CMD_ID.CS_CMD_CHECK_VERSION_RSP: CSCheckVersionRsp, # Name:CheckVersionRsp
	})

CSPkg = Struct(
	"Head" / CSPkgHead, 
	"Body" / CSPkgBody(selector=lambda this: int(this.Head.CmdID)), 
)
